ULL),('2505',1,'org/activiti/explorer/demo/process/reports/taskDurationForProcessDefinition.bpmn20.xml','2504','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<definitions xmlns=\"http://www.omg.org/spec/BPMN/20100524/MODEL\"\n    xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:activiti=\"http://activiti.org/bpmn\"\n    xmlns:bpmndi=\"http://www.omg.org/spec/BPMN/20100524/DI\" xmlns:omgdc=\"http://www.omg.org/spec/DD/20100524/DC\"\n    xmlns:omgdi=\"http://www.omg.org/spec/DD/20100524/DI\" typeLanguage=\"http://www.w3.org/2001/XMLSchema\"\n    expressionLanguage=\"http://www.w3.org/1999/XPath\" \n    targetNamespace=\"activiti-report\">\n\n    <process id=\"task-duration-report\" name=\"Task duration report\" isExecutable=\"true\">\n    \n        <startEvent id=\"startevent1\" name=\"Start\">\n          <extensionElements>\n            <activiti:formProperty id=\"processDefinition\" name=\"Select process definition\" type=\"processDefinition\" required=\"true\" />\n            <activiti:formProperty id=\"chartType\" name=\"Chart type\" type=\"enum\" required=\"true\">\n                <activiti:value id=\"pieChart\" name=\"Pie chart\" />\n                <activiti:value id=\"barChart\" name=\"Bar chart\" />\n            </activiti:formProperty>\n          </extensionElements>\n        </startEvent>\n        <sequenceFlow id=\"flow1\" sourceRef=\"startevent1\" targetRef=\"generateDataset\" />\n        \n        <scriptTask id=\"generateDataset\" name=\"Execute script\" scriptFormat=\"js\" activiti:autoStoreVariables=\"false\">\n          <script><![CDATA[\n          \n               importPackage(java.sql);\n               importPackage(java.lang);\n               importPackage(org.activiti.explorer.reporting);\n               \n               var processDefinition = execution.getVariable(\"processDefinition\");\n               \n               var result = ReportingUtil.executeSelectSqlQuery(\"select NAME_, avg(DURATION_) from ACT_HI_TASKINST where PROC_DEF_ID_ = \'\" + processDefinition.getId() + \"\' and END_TIME_ is not null group by NAME_\");\n            \n               /* JDK 7\n               \n               var reportData = {};\n               reportData.datasets = [];\n               \n               var dataset = {};\n               dataset.type = String(execution.getVariable(\"chartType\"));\n               dataset.description = \"Average task duration (in seconds) for process definition \'\" + processDefinition.getName() + \"\' (version \" + processDefinition.getVersion() + \")\";\n               dataset.data = {};\n               \n               while (result.next()) { // process results one row at a time\n                 var name = result.getString(1);\n                 var val = result.getLong(2) / 1000;\n                 dataset.data[name] = val;\n               }\n               reportData.datasets.push(dataset);\n               \n               execution.setVariable(\"reportData\", new java.lang.String(JSON.stringify(reportData)).getBytes(\"UTF-8\"));\n               \n               */\n               \n               /* JDK 6+ */\n               \n               var reportData = new ReportData();\n               var dataset = reportData.newDataset();\n               dataset.type = execution.getVariable(\"chartType\");\n               dataset.description = \"Average task duration (in seconds) for process definition \'\" + processDefinition.getName() + \"\' (version \" + processDefinition.getVersion() + \")\";\n               \n               while (result.next()) { // process results one row at a time\n                 var name = result.getString(1);\n                 var val = result.getLong(2) / 1000;\n                 dataset.add(name, val);\n               }\n               \n                execution.setVariable(\"reportData\", reportData.toBytes());\n               \n          ]]></script>\n        </scriptTask>\n        <sequenceFlow id=\"flow3\" sourceRef=\"generateDataset\" targetRef=\"theEnd\" />\n        \n        <endEvent id=\"theEnd\" />\n        \n    </process>\n\n</definitions>',0),('2506',1,'org/activiti/explorer/demo/process/reports/employeeProductivity.bpmn20.xml','2504','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<definitions xmlns=\"http://www.omg.org/spec/BPMN/20100524/MODEL\"\n    xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:activiti=\"http://activiti.org/bpmn\"\n    xmlns:bpmndi=\"http://www.omg.org/spec/BPMN/20100524/DI\" xmlns:omgdc=\"http://www.omg.org/spec/DD/20100524/DC\"\n    xmlns:omgdi=\"http://www.omg.org/spec/DD/20100524/DI\" typeLanguage=\"http://www.w3.org/2001/XMLSchema\"\n    expressionLanguage=\"http://www.w3.org/1999/XPath\" targetNamespace=\"activiti-report\">\n\n    <process id=\"employee-productivity-report\" name=\"Employee productivity\"\n        isExecutable=\"true\">\n\n        <startEvent id=\"startevent1\" name=\"Start\">\n            <extensionElements>\n                <activiti:formProperty id=\"employee\" name=\"Employee\"\n                    type=\"user\" required=\"true\" />\n                <activiti:formProperty id=\"month\" name=\"Month\"\n                    type=\"month\" required=\"true\" />\n            </extensionElements>\n        </startEvent>\n        <sequenceFlow id=\"flow1\" sourceRef=\"startevent1\"\n            targetRef=\"generateDataset\" />\n\n        <scriptTask id=\"generateDataset\" name=\"Execute script\"\n            scriptFormat=\"js\" activiti:autoStoreVariables=\"false\">\n            <script><![CDATA[\n          \n               importPackage(java.sql);\n               importPackage(java.lang);\n               importPackage(java.util);\n               importPackage(org.activiti.explorer.reporting);\n               \n              var reportData = {\n\"title\": \"My Report\",\n\"datasets\": [\n{\n\"type\" : \"lineChart\",\n\"description\" : \"My first chart\",\n\"xaxis\" : \"Category\",\n\"yaxis\" : \"Total sales\",\n\"data\" :\n{ \"2010\" : 50, \"2011\" : 33, \"2012\" : 17, \"2013\" : 87 }\n}\n]\n}; \nexecution.setVariable(\"reportData\", new java.lang.String(JSON.stringify(reportData)).getBytes(\"UTF-8\"));\n           \n          ]]></script>\n        </scriptTask>\n        <sequenceFlow id=\"flow3\" sourceRef=\"generateDataset\"\n            targetRef=\"theEnd\" />\n\n        <endEvent id=\"theEnd\" />\n\n    </process>\n\n</definitions>',0),('2507',1,'org/activiti/explorer/demo/process/reports/helpdeskFirstLineVsEscalated.bpmn20.xml','2504','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<definitions xmlns=\"http://www.omg.org/spec/BPMN/20100524/MODEL\"\n    xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:activiti=\"http://activiti.org/bpmn\"\n    xmlns:bpmndi=\"http://www.omg.org/spec/BPMN/20100524/DI\" xmlns:omgdc=\"http://www.omg.org/spec/DD/20100524/DC\"\n    xmlns:omgdi=\"http://www.omg.org/spec/DD/20100524/DI\" typeLanguage=\"http://www.w3.org/2001/XMLSchema\"\n    expressionLanguage=\"http://www.w3.org/1999/XPath\" \n    targetNamespace=\"activiti-report\">\n\n    <process id=\"helpdesk-firstline-vs-escalated-report\" name=\"Helpdesk process: firstline vs escalated\" isExecutable=\"true\">\n    \n        <startEvent id=\"startevent1\" name=\"Start\" />\n        <sequenceFlow id=\"flow1\" sourceRef=\"startevent1\" targetRef=\"generateDataset\" />\n        \n        <scriptTask id=\"generateDataset\" name=\"Execute script\" scriptFormat=\"js\" activiti:autoStoreVariables=\"false\">\n          <script><![CDATA[\n          \n               importPackage(java.sql);\n               importPackage(java.lang);\n               importPackage(org.activiti.explorer.reporting);\n               \n               var escalatedResult = ReportingUtil.executeSelectSqlQuery(\"SELECT count(*) FROM ACT_HI_ACTINST where END_TIME_ is not null and ACT_ID_ = \'handleEscalation\' and PROC_DEF_ID_ like \'escalationExample%\'\");\n               escalatedResult.next();\n               var escalatedCount = escalatedResult.getLong(1);\n               \n               var firstLineResult = ReportingUtil.executeSelectSqlQuery(\"SELECT count(*) FROM ACT_HI_PROCINST where END_TIME_ is not null and PROC_DEF_ID_ like \'escalationExample%\'\");\n               firstLineResult.next();\n               var firstLineCount = firstLineResult.getLong(1) - escalatedCount;\n               \n               /* JDK 7 only \n               var reportData = {};\n               \n               var dataset = {};\n               dataset.description = \"Helpdesk process: issues solved in first line vs escalation needed\";\n               dataset.type = \"pieChart\";\n               reportData.datasets = [];\n               \n               \n               if (escalatedCount > 0 || firstLineCount > 0) {\n                   dataset.data = {\"First line solved\" : firstLineCount, \"Escalation needed\" : escalatedCount};\n               } \n\n               reportData.datasets.push(dataset);\n               \n               execution.setVariable(\"reportData\", new java.lang.String(JSON.stringify(reportData)).getBytes(\"UTF-8\"));\n               */\n               \n               /* JDK 6+ */\n               \n               var reportData = new ReportData();\n               var dataset = reportData.newDataset();\n               dataset.description = \"Helpdesk process: issues solved in first line vs escalation needed\";\n               dataset.type = \"pieChart\";\n               \n               if (escalatedCount > 0 || firstLineCount > 0) {\n                 dataset.add(\"First line solved\", firstLineCount);\n                 dataset.add(\"Escalation needed\", escalatedCount);\n               } \n               \n               execution.setVariable(\"reportData\", reportData.toBytes());\n               \n          ]]></script>\n        </scriptTask>\n        <sequenceFlow id=\"flow3\" sourceRef=\"generateDataset\" targetRef=\"theEnd\" />\n        \n        <endEvent id=\"theEnd\" />\n        \n    </process>\n\n</definitions>',0),('2508',1,'org/activiti/explorer/demo/process/reports/processInstanceOverview.bpmn20.xml','2504','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<definitions xmlns=\"http://www.omg.org/spec/BPMN/20100524/MODEL\"\n    xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:activiti=\"http://activiti.org/bpmn\"\n    xmlns:bpmndi=\"http://www.omg.org/spec/BPMN/20100524/DI\" xmlns:omgdc=\"http://www.omg.org/spec/DD/20100524/DC\"\n    xmlns:omgdi=\"http://www.omg.org/spec/DD/20100524/DI\" typeLanguage=\"http://www.w3.org/2001/XMLSchema\"\n    expressionLanguage=\"http://www.w3.org/1999/XPath\" \n    targetNamespace=\"activiti-report\">\n\n    <process id=\"process-instance-overview-report\" name=\"Process Instance Overview\" isExecutable=\"true\">\n    \n        <startEvent id=\"startevent1\" name=\"Start\" />\n        <sequenceFlow id=\"flow1\" sourceRef=\"startevent1\" targetRef=\"generateDataset\" />\n        \n        <scriptTask id=\"generateDataset\" name=\"Execute script\" scriptFormat=\"js\" activiti:autoStoreVariables=\"false\">\n          <script><![CDATA[\n          \n               importPackage(java.sql);\n               importPackage(java.lang);\n               importPackage(org.activiti.explorer.reporting);\n               \n               var result = ReportingUtil.executeSelectSqlQuery(\"SELECT PD.NAME_, PD.VERSION_ , count(PI.ID_) FROM ACT_HI_PROCINST PI inner join ACT_RE_PROCDEF PD on PI.PROC_DEF_ID_ = PD.ID_ group by PI.ID_, PROC_DEF_ID_\");\n            \n               /* JDK 7 only\n               \n               var reportData = {};\n               reportData.datasets = [];\n               \n               var dataset = {};\n               dataset.type = \"pieChart\";\n               dataset.description = \"Process instance overview (\" + new java.util.Date() + \")\";\n               dataset.data = {};\n            \n               while (result.next()) { // process results one row at a time\n                 var name = result.getString(1);\n                 var version = result.getLong(2)\n                 var count = result.getLong(3);\n                 dataset.data[name + \" (v\" + version + \")\"] = count;\n               }\n               reportData.datasets.push(dataset);\n\n               var dataset2 = {};\n               dataset2.type=\"list\";\n               dataset2.description = \"List overview of process instances\";\n               dataset2.data = dataset.data;\n               reportData.datasets.push(dataset2);\n               \n               execution.setVariable(\"reportData\", new java.lang.String(JSON.stringify(reportData)).getBytes(\"UTF-8\"));\n               */\n               \n               /* JDK 6+ */\n               var reportData = new ReportData;\n               var dataset = reportData.newDataset();\n               dataset.type = \"pieChart\";\n               dataset.description = \"Process instance overview (\" + new java.util.Date() + \")\";\n               \n               while (result.next()) { // process results one row at a time\n                 var name = result.getString(1);\n                 var version = result.getLong(2);\n                 var count = result.getLong(3);\n                 dataset.add(name + \" (v\" + version + \")\", count);\n               }\n               \n               var dataset2 = reportData.newDataset();\n               dataset2.type=\"list\";\n               dataset2.description = \"List overview of process instances\";\n               dataset2.data = dataset.data;\n               \n               execution.setVariable(\"reportData\", reportData.toBytes());\n               \n          ]]></script>\n        </scriptTask>\n        <sequenceFlow id=\"flow3\" sourceRef=\"generateDataset\" targetRef=\"theEnd\" />\n        \n        <endEvent id=\"theEnd\" />\n        \n    </process>\n\n</definitions>',0),('26',1,'VacationRequest.bpmn20.xml','20','<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n\n<definitions id=\"definitions\"\n             targetNamespace=\"http://activiti.org/bpmn20\" \n             xmlns=\"http://www.omg.org/spec/BPMN/20100524/MODEL\"\n             xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\"\n             xmlns:activiti=\"http://activiti.org/bpmn\">\n  \n  <process id=\"vacationRequest\" name=\"Vacation request\">\n  \n    <startEvent id=\"request\" activiti:initiator=\"employeeName\">\n      <extensionElements>\n        <activiti:formProperty id=\"numberOfDays\" name=\"Number of days\" type=\"long\" value=\"1\" required=\"true\"/>\n        <activiti:formProperty id=\"startDate\" name=\"First day of holiday (dd-MM-yyy)\" datePattern=\"dd-MM-yyyy hh:mm\" type=\"date\" required=\"true\" />\n        <activiti:formProperty id=\"vacationMotivation\" name=\"Motivation\" type=\"string\" />\n      </extensionElements>\n    </startEvent>\n    <sequenceFlow id=\"flow1\" sourceRef=\"request\" targetRef=\"handleRequest\" />\n    \n    <userTask id=\"handleRequest\" name=\"Handle vacation request\" >\n      <documentation>\n        ${employeeName} would like to take ${numberOfDays} day(s) of vacation (Motivation: ${vacationMotivation}).\n      </documentation> \n      <extensionElements>\n         <activiti:formProperty id=\"vacationApproved\" name=\"Do you approve this vacation\" type=\"enum\" required=\"true\">\n          <activiti:value id=\"true\" name=\"Approve\" />\n          <activiti:value id=\"false\" name=\"Reject\" />\n        </activiti:formProperty>\n        <activiti:formProperty id=\"managerMotivation\" name=\"Motivation\" type=\"string\" />\n      </extensionElements>\n      <potentialOwner>\n        <resourceAssignmentExpression>\n          <formalExpression>management</formalExpression>\n        </resourceAssignmentExpression>\n      </potentialOwner>         \n    </userTask>\n    <sequenceFlow id=\"flow2\" sourceRef=\"handleRequest\" targetRef=\"requestApprovedDecision\" />\n    \n    <exclusiveGateway id=\"requestApprovedDecision\" name=\"Request approved?\" />\n    <sequenceFlow id=\"flow3\" sourceRef=\"requestApprovedDecision\" targetRef=\"sendApprovalMail\">\n      <conditionExpression xsi:type=\"tFormalExpression\">${vacationApproved == \'true\'}</conditionExpression>\n    </sequenceFlow>\n    \n    <task id=\"sendApprovalMail\" name=\"Send confirmation e-mail\" />\n    <sequenceFlow id=\"flow4\" sourceRef=\"sendApprovalMail\" targetRef=\"theEnd1\" />\n    <endEvent id=\"theEnd1\" />\n    \n    <sequenceFlow id=\"flow5\" sourceRef=\"requestApprovedDecision\" targetRef=\"adjustVacationRequestTask\">\n      <conditionExpression xsi:type=\"tFormalExpression\">${vacationApproved == \'false\'}</conditionExpression>\n    </sequenceFlow>\n    \n    <userTask id=\"adjustVacationRequestTask\" name=\"Adjust vacation request\">\n      <documentation>\n        Your manager has disapproved your vacation request for ${numberOfDays} days.\n        Reason: ${managerMotivation}\n      </documentation>\n      <extensionElements>\n        <activiti:formProperty id=\"numberOfDays\" name=\"Number of days\" value=\"${numberOfDays}\" type=\"long\" required=\"true\"/>\n        <activiti:formProperty id=\"startDate\" name=\"First day of holiday (dd-MM-yyy)\" value=\"${startDate}\" datePattern=\"dd-MM-yyyy hh:mm\" type=\"date\" required=\"true\" />\n        <activiti:formProperty id=\"vacationMotivation\" name=\"Motivation\" value=\"${vacationMotivation}\" type=\"string\" />\n        <activiti:formProperty id=\"resendRequest\" name=\"Resend vacation request to manager?\" type=\"enum\" required=\"true\">\n          <activiti:value id=\"true\" name=\"Yes\" />\n          <activiti:value id=\"false\" name=\"No\" />\n        </activiti:formProperty>\n      </extensionElements>\n      <humanPerformer>\n        <resourceAssignmentExpression>\n          <formalExpression>${employeeName}</formalExpression>\n        </resourceAssignmentExpression>\n      </humanPerformer>  \n    </userTask>\n    <sequenceFlow id=\"flow6\" sourceRef=\"adjustVacationRequestTask\" targetRef=\"resendRequestDecision\" />\n    \n    <exclusiveGateway id=\"resendRequestDecision\" name=\"Resend request?\" />\n    <sequenceFlow id=\"flow7\" sourceRef=\"resendRequestDecision\" targetRef=\"handleRequest\">\n      <conditionExpression xsi:type=\"tFormalExpression\">${resendRequest == \'true\'}</conditionExpression>\n    </sequenceFlow>\n    \n     <sequenceFlow id=\"flow8\" sourceRef=\"resendRequestDecision\" targetRef=\"theEnd2\">\n      <conditionExpression xsi:type=\"tFormalExpression\">${resendRequest == \'false\'}</conditionExpression>\n    </sequenceFlow>\n    <endEvent id=\"theEnd2\" />\n      \n  </process>\n  \n</definitions>\n',0),('27',1,'oneTaskProcess.bpmn20.xml','20','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<definitions\n  xmlns=\"http://www.omg.org/spec/BPMN/20100524/MODEL\"\n  xmlns:activiti=\"http://activiti.org/bpmn\"\n  targetNamespace=\"Examples\">\n\n  <process id=\"oneTaskProcess\" name=\"Famous One Task Process\">\n  \n    <startEvent id=\"theStart\" activiti:initiator=\"initiator\" />\n    <sequenceFlow id=\"flow1\" sourceRef=\"theStart\" targetRef=\"theTask\" />\n    <userTask id=\"theTask\" name=\"my task\" activiti:assignee=\"${initiator}\" />    \n    <sequenceFlow id=\"flow2\" sourceRef=\"theTask\" targetRef=\"theEnd\" />\n    <endEvent id=\"theEnd\" />\n    \n  </process>\n\n</definitions>\n',0),('28',1,'FixSystemFailureProcess.bpmn20.xml','20','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<definitions id=\"definitions\" \n  xmlns=\"http://www.omg.org/spec/BPMN/20100524/MODEL\"\n  xmlns:activiti=\"http://activiti.org/bpmn\"\n  targetNamespace=\"Examples\">\n  \n  <process id=\"fixSystemFailure\" name=\"Fix system failure\">\n  \n    <startEvent id=\"theStart\" />\n    \n    <sequenceFlow id=\"flow1\" sourceRef=\"theStart\" targetRef=\"subProcess\" />\n    \n    <subProcess id=\"subProcess\">\n    \n      <startEvent id=\"subProcessStart\" />\n      <sequenceFlow id=\"flow2\" sourceRef=\"subProcessStart\" targetRef=\"subProcessFork\" />\n      \n      <parallelGateway id=\"subProcessFork\" />\n      <sequenceFlow id=\"flow3\" sourceRef=\"subProcessFork\" targetRef=\"task1\" />\n      <sequenceFlow id=\"flow4\" sourceRef=\"subProcessFork\" targetRef=\"task2\" />\n      \n      <userTask id=\"task1\" name=\"Investigate hardware\" activiti:candidateGroups=\"engineering\" />\n      <sequenceFlow id=\"flow5\" sourceRef=\"task1\" targetRef=\"subProcessJoin\" />\n      \n      <userTask id=\"task2\" name=\"Investigate software\" activiti:candidateGroups=\"engineering\" />\n      <sequenceFlow id=\"flow6\" sourceRef=\"task2\" targetRef=\"subProcessJoin\" />\n      \n      <parallelGateway id=\"subProcessJoin\" />\n      <sequenceFlow id=\"flow7\" sourceRef=\"subProcessJoin\" targetRef=\"subProcessEnd\" />\n      <endEvent id=\"subProcessEnd\" />\n    \n    </subProcess>\n    \n    <!-- Timer on subprocess -->\n    <boundaryEvent id=\"timer\" attachedToRef=\"subProcess\">\n      <timerEventDefinition>\n        <timeDuration>PT4H</timeDuration>\n      </timerEventDefinition>\n    </boundaryEvent>\n    <sequenceFlow id=\"flow8\" sourceRef=\"timer\" targetRef=\"taskAfterTimer\" />\n    <userTask id=\"taskAfterTimer\" name=\"Hand over to Level 2 support\" activiti:candidateGroups=\"management\" />\n    <sequenceFlow id=\"flow9\" sourceRef=\"taskAfterTimer\" targetRef=\"theEnd1\" />\n    <endEvent id=\"theEnd1\" />\n    \n    <sequenceFlow id=\"flow10\" sourceRef=\"subProcess\" targetRef=\"taskAfterSubProcess\" />\n    <userTask id=\"taskAfterSubProcess\" name=\"Write report\" activiti:candidateGroups=\"engineering\" />\n    <sequenceFlow id=\"flow11\" sourceRef=\"taskAfterSubProcess\" targetRef=\"theEnd\" />\n    <endEvent id=\"theEnd\" />\n    \n  </process>\n\n</definitions>',0),('29',1,'Helpdesk.bpmn20.xml','20','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<definitions id=\"definitions\"\n	xmlns=\"http://www.omg.org/spec/BPMN/20100524/MODEL\" \n	xmlns:ac